import { api } from '.';
import { RegisterUser, LoginUser } from '../type';

export type LoginUser = {
    email: string;
    password: string;
};

const registerUser = async (body: RegisterUser) => {
    try {
        const res = await api.post('/register', body);
        return res.data;
    } catch (err) {
        console.error(err);
    }
};

const loginUser = async (body: LoginUser) => {
    try {
        const res = await api.post('/login', body);
        return res.data;
    } catch (err) {
        console.error(err);
    }
};

export { registerUser, loginUser };
